description:
Tankies: Tank Heroes of World War II

War Documentary hosted by Mark Urban, published by BBC in 2013 - English narration


Information
------------------------------

Historian and former tank commander Mark Urban tells the story of six remarkable men from the Fifth Royal Tank Regiment across World War II. Surviving veterans and previously unseen letters and diaries relate in visceral detail how an extraordinary &quot;band of brothers&quot; fought throughout the war.

